fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:land_resource rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_realm ;
            owl:someValuesFrom :land ],
        :natural_resource .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_resource rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_realm ;
            owl:someValuesFrom :body_of_water ],
        :natural_resource .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrocarbon rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :hx ;
            owl:onProperty :has_chemical_2 ],
        [ a owl:Restriction ;
            owl:hasValue :cx ;
            owl:onProperty :has_chemical_1 ],
        :organic_compound .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:methane_clathrate rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :methane ;
            owl:onProperty :has_substance ],
        :clathrate_hydrate,
        :gas_hydrate ;
    owl:equivalentClass :methane_hydrate,
        :methane_ice .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organic_substance rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :c ;
            owl:onProperty :has_chemical ],
        :substance .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organochloride rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :cl ;
            owl:onProperty :has_chemical ],
        :organic_compound .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nucleon rdfs:subClassOf owl:Thing ;
    owl:equivalentClass [ owl:unionOf [ rdf:first :neutron ;
                    rdf:rest [ rdf:first :proton ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:subatomic_particle rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :subatomic_scale ;
            owl:onProperty :has_spatial_scale ],
        :substance .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_part rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :plant ;
            owl:onProperty :component_of ],
        :living_entity .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tree_ring rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :tree ;
            owl:onProperty :component_of ],
        :plant_part .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:metamorphic_rock rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :metamorphic ;
            owl:onProperty :has_genesis ],
        :rock .
